import React, { useEffect } from "react";
import "../Layout.css";

const Events = () => {
  useEffect(() => {
    // Parse Facebook widgets när komponenten mountas
    if (window.FB) {
      window.FB.XFBML.parse();
    }
  }, []);

  return (
    <div className="events-container">
      <h1>Evenemang</h1>
      <div className="events-wrapper">
        <div
          className="fb-page"
          data-href="https://www.facebook.com/KumlaSportfiske/events"
          data-tabs="events"
          data-width="100%"
          data-height="600"
          data-small-header="false"
          data-adapt-container-width="true"
          data-hide-cover="false"
          data-show-facepile="true"
        ></div>
      </div>
    </div>
  );
};

export default Events;
